int8_t * GpuSqlDispatcher::allocateRegister(std::string reg)
{
	int8_t * mask;
	GPUMemory::alloc<int8_t>(&mask, database->GetBlockSize());
	registerPointers.insert({ reg, reinterpret_cast<std::uintptr_t>(mask) });
	return mask;
}

